import './style.css';

export default function SectionInformations() {
    return (
        <div className="container-section">
            <div className="call-back">
                <h1>Call Back</h1>                
            </div>

            <div className="callback-img">
                <h1>Imagem celular</h1>
            </div>

            <div className="callback-simulation">
                <h1>simulador</h1>
            </div>
        </div>
    )
}
